import React, {Component} from 'react';
import './Homepage.css';
import './css/main.css';
import './css/util.css';
export class Homepage extends Component(name, backhome) {
	render(){
        return (
            <div >
    		    {
                    <div>
                        <h1>Welcome, {name}.</h1>
				        <button onClick={backhome} className="container-login100-form-btn">Logout!</button>
   			        </div>
                }
    		</div>
		)
	}
}
export default Homepage;
